[{'url': 'https://api.github.com/repos/robbert-vdh/nih-plug/issues/84', 'repository_url': 'https://api.github.com/repos/robbert-vdh/nih-plug', 'labels_url': 'https://api.github.com/repos/robbert-vdh/nih-plug/issues/84/labels{/name}', 'comments_url': 'https://api.github.com/repos/robbert-vdh/nih-plug/issues/84/comments', 'events_url': 'https://api.github.com/repos/robbert-vdh/nih-plug/issues/84/events', 'html_url': 'https://github.com/robbert-vdh/nih-plug/issues/84', 'id': 1889372997, 'node_id': 'I_kwDOGusTJM5wnYtF', 'number': 84, 'title': 'Subtle eroding of velocity values (CLAP only)', 'user': {'login': 'ijijn', 'id': 6064114, 'node_id': 'MDQ6VXNlcjYwNjQxMTQ=', 'avatar_url': 'https://avatars.githubusercontent.com/u/6064114?v=4', 'gravatar_id': '', 'url': 'https://api.github.com/users/ijijn', 'html_url': 'https://github.com/ijijn', 'followers_url': 'https://api.github.com/users/ijijn/followers', 'following_url': 'https://api.github.com/users/ijijn/following{/other_user}', 'gists_url': 'https://api.github.com/users/ijijn/gists{/gist_id}', 'starred_url': 'https://api.github.com/users/ijijn/starred{/owner}{/repo}', 'subscriptions_url': 'https://api.github.com/users/ijijn/subscriptions', 'organizations_url': 'https://api.github.com/users/ijijn/orgs', 'repos_url': 'https://api.github.com/users/ijijn/repos', 'events_url': 'https://api.github.com/users/ijijn/events{/privacy}', 'received_events_url': 'https://api.github.com/users/ijijn/received_events', 'type': 'User', 'site_admin': False}, 'labels': [], 'state': 'closed', 'locked': False, 'assignee': None, 'assignees': [], 'milestone': None, 'comments': 2, 'created_at': '2023-09-10T22:54:46Z', 'updated_at': '2023-09-19T00:40:03Z', 'closed_at': '2023-09-16T15:58:30Z', 'author_association': 'NONE', 'active_lock_reason': None, 'body': 'Hi again folks!

I recently noticed a weird thing, after much scratching of the head, that whenever I put an nih-plug CLAP plugin on a track, processed MIDI events would generally decrease their velocity by a small amount: most notes would lose 1 "point" of velocity per instance, while some would remain unchanged. Other details, such as CC values, were unaffected, however. For reference, this was with the latest Reaper version on Windows 11, even for plugins that do _absolutely nothing_ to the MIDI (see the bottom of this post for a quick example).

I tried the equivalent VST3 builds and everything was fine. I considered that this could be a fault in Reaper's handling of CLAP, but I downloaded another CLAP plugin to see (namely, Ny by Full Bucket Music) and that one's MIDI-thru worked perfectly.

After this initial round of testing, I thought that maybe there was a calibration error between the velocity values of nih-plug and CLAP, and that does indeed seem to be the case: as far as I can tell, CLAP's `f64` velocities operate on a range from 0.0 (0) to 1.0 (128) (i.e. `value / 128.0`) whereas here we use `value / 127.0` for our `f32`s (EDIT: oops, wrote that backwards before). In any case, I patched the velocity conversion logic and the problem went away completely, working across the full range of inputs. A pull request is incoming with these minor changes for consideration.

Thanks as always and all the best,
Iain

